this["App"]["Templates"]["reusables/abcom-buttons"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Buttons</h2>\r\n<hr>\r\n<h3>Button Tags</h3>\r\n<p>You can create buttons under Aboitiz Legal website / cms. Below are the sample buttons. Aboitiz Legal buttons utilizes features from bootstrap, so you can actually create a button by giving it a class like <code>btn</code>.</p>\r\n<div class=\"panel panel-default\">\r\n	<div id=\"abcom-buttons\" class=\"panel-body\">\r\n		<p>\r\n			<button class=\"btn abcom-btn abcom-btn--default\">Button</button>\r\n			<a href=\"javascript:;\" role=\"button\" class=\"btn abcom-btn abcom-btn--default\">Button</a>\r\n			<span role=\"button\" class=\"btn abcom-btn abcom-btn--default\">Button</span>\r\n		</p>\r\n		<p>Here is the sample code for a button using <code>&lt;button&gt;</code> element.</p> \r\n		<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--default&quot;&gt;Button&lt;/button&gt;</code></pre>\r\n		<p>You can also use <code>&lt;a&gt;</code> element like this.</p> \r\n		<pre class=\"yondu__code\"><code>&lt;a href=&quot;javascript:;&quot; role=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default&quot;&gt;Button&lt;/a&gt;</code></pre>\r\n		<p>or use other element like <code>&lt;span&gt;</code>.</p> \r\n		<pre class=\"yondu__code\"><code>&lt;span role=&quot;button&quot; class=&quot;btn abcom-btn abcom-btn--default&quot;&gt;Button&lt;/span&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<hr>\r\n<h3>Colors</h3>\r\n<p>Use any of the available button classes to quickly create a styled button.</p>\r\n<div class=\"panel panel-default\">\r\n	<div id=\"abcom-buttons\" class=\"panel-body\">\r\n		<p>\r\n			<button class=\"btn abcom-btn abcom-btn--default\">Button</button>\r\n			<button class=\"btn abcom-btn abcom-btn--action\">Button</button>\r\n			<button class=\"btn abcom-btn abcom-btn--cool\">Button</button>\r\n			<button class=\"btn abcom-btn abcom-btn--cooler\">Button</button>\r\n		</p>\r\n		<p>Here is the default <code>&lt;button&gt;</code> element.</p> \r\n		<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--default&quot;&gt;Button&lt;/button&gt;</code></pre>\r\n		<p>here is the action type <code>&lt;button&gt;</code> element.</p> \r\n		<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--action&quot;&gt;Button&lt;/button&gt;</code></pre>\r\n		<p>here are the accent type <code>&lt;button&gt;</code> element.</p> \r\n		<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--cool&quot;&gt;Button&lt;/button&gt;</code></pre>\r\n		<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--cooler&quot;&gt;Button&lt;/button&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<hr>\r\n<h3>Rounded Corners</h3>\r\n<p>You can also style the button if it has rounded corners.</p>\r\n<div class=\"panel panel-default\">\r\n	<div id=\"abcom-buttons\" class=\"panel-body\">\r\n		<p>\r\n			<button class=\"btn abcom-btn abcom-btn--default abcom-btn--rounded\">Button</button>\r\n			<button class=\"btn abcom-btn abcom-btn--action abcom-btn--rounded\" >Button</button>\r\n			<button class=\"btn abcom-btn abcom-btn--cool abcom-btn--rounded\">Button</button>\r\n			<button class=\"btn abcom-btn abcom-btn--cooler abcom-btn--rounded\">Button</button>\r\n		</p>\r\n		<p>Here is the code for using rounded <code>&lt;button&gt;</code> element.</p> \r\n		<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--default abcom-btn--rounded&quot;&gt;Button&lt;/button&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<hr>\r\n<h3>Button with Icons</h3>\r\n<p>Buttons can have icons preceding its text.</p>\r\n<div class=\"panel panel-default\">\r\n	<div id=\"abcom-buttons\" class=\"panel-body\">\r\n		<p>\r\n			<button class=\"btn abcom-btn abcom-btn--default\"><i class=\"fa fa-home\"></i>Button</button>\r\n		</p>\r\n		<p>Just add a font awesome icon. For example: <code>&lt;i class=&quot;fa fa-home&quot;&gt;&lt;/i&gt;</code>.</p> \r\n		<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--default&quot;&gt;&lt;i class=&quot;fa fa-home&quot;&gt;&lt;/i&gt;Button&lt;/button&gt;</code></pre>\r\n	</div>\r\n</div>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-container"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Container</h2>\r\n<p>Insert a container and modify alignments using this component</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;abcom-container&quot;&gt;&lt;/div&gt;</code></pre>\r\n		<p>To provide alignment, use <code>abcom-container--left</code>, <code>abcom-container--center</code> or <code>abcom-container--right</code>:</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;abcom-container abcom-container--center&quot;&gt;&lt;/div&gt;</code></pre>\r\n	</div>\r\n</div>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-donut"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Donut Chart</h2>\r\n<p>Displays a graphical representation of a certain number or count. This component is useful for displaying surveys, or any type of record counting.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<!-- insert section title component here -->\r\n		<div id=\"donut_id\" class=\"abcom abcom-donut\">\r\n			<div class=\"donut\">\r\n				<h1>35</h1>\r\n				<div>Requests Approved</div>\r\n			    <svg width=\"150\" height=\"150\" xmlns=\"http://www.w3.org/2000/svg\">\r\n			     <g>\r\n			      <title>Layer 1</title>\r\n			      <circle id=\"circle\" class=\"filler\" r=\"69.85699\" cy=\"75\" cx=\"75\" fill=\"none\"/>\r\n			      <circle id=\"circle\" class=\"circle_animation\" r=\"69.85699\" cy=\"75\" cx=\"75\" fill=\"none\"/>\r\n			     </g>\r\n			    </svg>\r\n			</div>\r\n		</div>\r\n		<p>Here is the sample code:</p>\r\n<pre class=\"yondu__code\"><code>&lt;div id=&quot;donut_id&quot; class=&quot;abcom abcom-donut&quot;&gt;\r\n    &lt;div class=&quot;donut&quot;&gt;\r\n        &lt;h1&gt;35&lt;/h1&gt;\r\n        &lt;div&gt;Requests Approved&lt;/div&gt;\r\n        &lt;svg width=&quot;150&quot; height=&quot;150&quot; xmlns=&quot;http://www.w3.org/2000/svg&quot;&gt;\r\n         &lt;g&gt;\r\n          &lt;title&gt;Layer 1&lt;/title&gt;\r\n          &lt;circle id=&quot;circle&quot; class=&quot;filler&quot; r=&quot;69.85699&quot; cy=&quot;75&quot; cx=&quot;75&quot; fill=&quot;none&quot;/&gt;\r\n          &lt;circle id=&quot;circle&quot; class=&quot;circle_animation&quot; r=&quot;69.85699&quot; cy=&quot;75&quot; cx=&quot;75&quot; fill=&quot;none&quot;/&gt;\r\n         &lt;/g&gt;\r\n        &lt;/svg&gt;\r\n    &lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n	<p>Instantiate the Donut Chart using javascript:</p>\r\n<pre class=\"yondu__code\"><code>var donut = $('#donut_id');\r\ninitDonut(donut);</code></pre>\r\n<p>Here, we declared a variable that contains the element to manipulate, and use the <code>initDonut</code> function to animate the chart.</p>\r\n	</div>\r\n</div>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-filter"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Search Filter Bar</h2>\r\n<p>Displays the filter section for a recordset. The section also occupies the width of its parent container.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<!-- insert section title component here -->\r\n		<div class=\"abcom abcom-filter nav\">\r\n			<div class=\"navbar-left\">\r\n				<div class=\"form-group\">\r\n					<label for=\"\" class=\"abcom-filter__label\">Filter/Search by:</label>\r\n		        	<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--min form-control\">\r\n		        		<option selected>Select Category</option>\r\n		        		<option value=\"\">Creator</option>\r\n		        		<option value=\"\">Date</option>\r\n		        		<option value=\"\">Status Name</option>\r\n		        	</select>\r\n		        	<input type=\"text\" class=\"form-control abcom-form abcom-form--min\" placeholder=\"Search here...\">\r\n		    	</div>\r\n			</div>\r\n			<div class=\"navbar-right\">\r\n				<div class=\"form-group\">\r\n					<label for=\"\" class=\"abcom-filter__label\">Entries per page</label>\r\n		        	<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--min form-control\">\r\n		        		<option value=\"10\">10</option>\r\n		        		<option value=\"15\">15</option>\r\n		        		<option value=\"20\">20</option>\r\n		        		<option value=\"50\">50</option>\r\n		        	</select>\r\n		    	</div>\r\n			</div>\r\n		</div>\r\n		<p>Here is the code sample for the Search Filter Section:</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;abcom abcom-filter nav&quot;&gt;\r\n    &lt;div class=&quot;navbar-left&quot;&gt;\r\n        &lt;div class=&quot;form-group&quot;&gt;\r\n            &lt;label for=&quot;&quot; class=&quot;abcom-filter__label&quot;&gt;Filter/Search by:&lt;/label&gt;\r\n            &lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--min form-control&quot;&gt;\r\n                &lt;option selected&gt;Select Category&lt;/option&gt;\r\n                &lt;option value=&quot;&quot;&gt;Creator&lt;/option&gt;\r\n                &lt;option value=&quot;&quot;&gt;Date&lt;/option&gt;\r\n                &lt;option value=&quot;&quot;&gt;Status Name&lt;/option&gt;\r\n            &lt;/select&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n    &lt;div class=&quot;navbar-right&quot;&gt;\r\n        &lt;div class=&quot;form-group&quot;&gt;\r\n            &lt;button class=&quot;btn abcom-btn abcom-btn--default abcom-btn--rounded&quot;&gt;View Legends&lt;/button&gt;\r\n            &lt;label for=&quot;&quot; class=&quot;abcom-filter__label&quot;&gt;Entries per page&lt;/label&gt;\r\n            &lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--min form-control&quot;&gt;\r\n                &lt;option value=&quot;10&quot;&gt;10&lt;/option&gt;\r\n                &lt;option value=&quot;15&quot;&gt;15&lt;/option&gt;\r\n                &lt;option value=&quot;20&quot;&gt;20&lt;/option&gt;\r\n                &lt;option value=&quot;50&quot;&gt;50&lt;/option&gt;\r\n            &lt;/select&gt;\r\n        &lt;/div&gt;\r\n    &lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n	</div>\r\n</div>";
},"useData":true});

this["App"]["Templates"]["reusables/abcom-forms"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Forms</h2>\r\n<p>Forms play a huge part especially inside a CMS website / app. Aboitiz Legal has this set of form elements for you to use.</p>\r\n\r\n<h3>Labels</h3>\r\n<p>Labels will be in fixed <code>40px</code> height.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<label for=\"\" class=\"abcom-form\">This is a Label</label>\r\n	</div>\r\n</div>\r\n<pre class=\"yondu__code\"><code>&lt;label for=&quot;&quot; class=&quot;abcom-form&quot;&gt;This is a Label&lt;/label&gt;</code></pre>\r\n<h3>Input box</h3>\r\n<p>This utilizes bootstrap feature for styling inputs.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<p>This sample is the default size:</p>\r\n		<input type=\"text\" class=\"form-control abcom-form abcom-form--min abcom-form--hasmargin\" placeholder=\"This is an Input\">\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;text&quot; class=&quot;form-control abcom-form abcom-form--min abcom-form--hasmargin&quot; placeholder=&quot;This is an Input&quot;&gt;</code></pre>\r\n		<p>This sample will occupy the width of its parent element:</p>\r\n		<input type=\"text\" class=\"form-control abcom-form abcom-form--full abcom-form--hasmargin\" placeholder=\"This is an Input\">\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;text&quot; class=&quot;form-control abcom-form abcom-form--full abcom-form--hasmargin&quot; placeholder=&quot;This is an Input&quot;&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<h3>Textarea</h3>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<p>Here is a sample of a Textarea:</p>\r\n		<textarea class=\"form-control abcom-form abcom-form--full abcom-form--hasmargin\" placeholder=\"This is a Textarea\"></textarea>\r\n<pre class=\"yondu__code\"><code>&lt;textarea class=&quot;form-control abcom-form abcom-form--full abcom-form--hasmargin&quot; placeholder=&quot;This is a Textarea&quot;&gt;&lt;/textarea&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<h3>Select Dropdown</h3>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<p>Dropdown utilizes a bootstrap plugin called bootstrap select</p>\r\n		<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--min abcom-form--hasmargin form-control\">\r\n    		<option selected>Select Category</option>\r\n    		<option value=\"\">Creator</option>\r\n    		<option value=\"\">Date</option>\r\n    		<option value=\"\">Status Name</option>\r\n    	</select>\r\n<pre class=\"yondu__code\"><code>&lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--min abcom-form--hasmargin form-control&quot;&gt;\r\n    &lt;option selected&gt;Select Category&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Creator&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Date&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Status Name&lt;/option&gt;\r\n&lt;/select&gt;</code></pre>\r\n		<p>Or again, you can use a full width select dropdown</p>\r\n		<select name=\"\" id=\"\" class=\"selectpicker abcom-form abcom-form--full abcom-form--hasmargin form-control\">\r\n    		<option selected>Select Category</option>\r\n    		<option value=\"\">Creator</option>\r\n    		<option value=\"\">Date</option>\r\n    		<option value=\"\">Status Name</option>\r\n    	</select>\r\n<pre class=\"yondu__code\"><code>&lt;select name=&quot;&quot; id=&quot;&quot; class=&quot;selectpicker abcom-form abcom-form--full abcom-form--hasmargin form-control&quot;&gt;\r\n    &lt;option selected&gt;Select Category&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Creator&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Date&lt;/option&gt;\r\n    &lt;option value=&quot;&quot;&gt;Status Name&lt;/option&gt;\r\n&lt;/select&gt;</code></pre>\r\n	</div>\r\n</div>\r\n\r\n<h3>Form Buttons</h3>\r\n<p>Form buttons utilize the default buttons.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		\r\n		<p>Here is the action type button. It is useful for accent type or main function buttons like submit.</p>\r\n		<input type=\"submit\" class=\"btn abcom-btn abcom-btn--action abcom-form--hasmargin\" value=\"Submit\">\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;submit&quot; class=&quot;btn abcom-btn abcom-btn--action abcom-form--hasmargin&quot; value=&quot;Submit&quot;&gt;</code></pre>\r\n		\r\n		<p>Here is the default type button.</p>\r\n		<input type=\"button\" class=\"btn abcom-btn abcom-btn--default abcom-form--hasmargin\" value=\"Preview\">\r\n<pre class=\"yondu__code\"><code>&lt;input type=&quot;submit&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-form--hasmargin&quot; value=&quot;Preview&quot;&gt;</code></pre>\r\n		<button type=\"submit\" class=\"btn abcom-btn abcom-btn--default abcom-form--hasmargin\">Save</button>\r\n<pre class=\"yondu__code\"><code>&lt;button type=&quot;submit&quot; class=&quot;btn abcom-btn abcom-btn--default abcom-form--hasmargin&quot;&gt;Save&lt;/button&gt;</code></pre>\r\n\r\n		<p>You can also add icons same with how we use our buttons component.</p>\r\n		<button class=\"btn abcom-btn abcom-btn--default abcom-form--hasmargin\"><i class=\"fa fa-ban\"></i>Remove</button>\r\n<pre class=\"yondu__code\"><code>&lt;button class=&quot;btn abcom-btn abcom-btn--default abcom-form--hasmargin&quot;&gt;&lt;i class=&quot;fa fa-ban&quot;&gt;&lt;/i&gt;Remove&lt;/button&gt;</code></pre>\r\n		<p>Note: You cannot use <code>&lt;input type=&quot;submit&quot;&gt;</code> for buttons with icon. So, we should use <code>&lt;button&gt;</code> tag instead. and bind its click function to our submit using jquery like:\r\n<pre class=\"yondu__code\"><code>$('#submit_btn').click(function(){\r\n  $('#form_id').submit();\r\n});</code></pre>\r\n	</div>\r\n</div>";
},"useData":true});

