this["App"]["Templates"]["reusables/abcom-modal"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Modal</h2>\r\n<p>Displays a separate container above the document, with a faded black background.</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<div class=\"modal fade abcom-modal\" tabindex=\"-1\" role=\"dialog\">\r\n		  <div class=\"modal-dialog\">\r\n		    <div class=\"modal-content\">\r\n			  	<div class=\"modal-header\">\r\n			        <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\"><span aria-hidden=\"true\">&times;</span></button>\r\n			    	<h4 class=\"modal-title\" id=\"myModalLabel\">Modal title</h4>\r\n			    </div>\r\n			    <div class=\"modal-body\">...</div>\r\n		    </div>\r\n		  </div>\r\n		</div>\r\n		\r\n<p>Declaring the toggle button for the modal. It is important to use the <code>data-toggle</code> and <code>data-target</code> on a button to utilize bootstrap modal component.</p>\r\n<pre class=\"yondu__code\"><code>&lt;button data-toggle=&quot;modal&quot; data-target=&quot;.abcom-modal&quot; class=&quot;btn abcom-btn abcom-btn--default&quot;&gt;Launch Demo&lt;/button&gt;</code></pre>\r\n\r\n<p>Here is a sample code for the modal. Take note of the <code>class</code> that is in turn being targeted by the button.</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;modal fade abcom-modal&quot; tabindex=&quot;-1&quot; role=&quot;dialog&quot;&gt;\r\n  &lt;div class=&quot;modal-dialog&quot;&gt;\r\n    &lt;div class=&quot;modal-content&quot;&gt;\r\n        &lt;div class=&quot;modal-header&quot;&gt;\r\n            &lt;button type=&quot;button&quot; class=&quot;close&quot; data-dismiss=&quot;modal&quot; aria-label=&quot;Close&quot;&gt;&lt;span aria-hidden=&quot;true&quot;&gt;&times;&lt;/span&gt;&lt;/button&gt;\r\n            &lt;h4 class=&quot;modal-title&quot; id=&quot;myModalLabel&quot;&gt;Modal title&lt;/h4&gt;\r\n        &lt;/div&gt;\r\n        &lt;div class=&quot;modal-body&quot;&gt;...&lt;/div&gt;\r\n    &lt;/div&gt;\r\n  &lt;/div&gt;\r\n&lt;/div&gt;</code></pre>\r\n\r\n<button data-toggle=\"modal\" data-target=\".abcom-modal\" class=\"btn abcom-btn abcom-btn--default\">Launch Demo</button>\r\n<p></p>\r\n<p>You can also use the modal size from bootstrap by adding a <code>modal-sm</code> or <code>modal-lg</code> in the <code>modal-dialog</code> class.</p>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;modal-dialog modal-sm&quot;&gt;</code></pre>\r\n<pre class=\"yondu__code\"><code>&lt;div class=&quot;modal-dialog modal-lg&quot;&gt;</code></pre>\r\n	</div>\r\n</div>";
},"useData":true});

