    return "<h2>Progress Bar</h2>\r\n<p>This is used for Status (Progress bar)</p>\r\n<div class=\"panel panel-default\">\r\n	<div class=\"panel-body\">\r\n		<progress class=\"abcom-progress\" data-status=\"For Endorsement\" value=\"60\" max=\"100\"></progress>\r\n		<p>This are used especially inside a table data whenever a request page is concerned.</p>\r\n<pre class=\"yondu__code\"><code>&lt;progress class=&quot;abcom-progress&quot; data-status=&quot;For Endorsement&quot; value=&quot;60&quot; max=&quot;100&quot;&gt;&lt;/progress&gt;</code></pre>\r\n\r\n		<h3>Sample with Data Tables</h3>\r\n		<p>Here is a sample code for integrating progress status bar inside a table</p>\r\n		<table id=\"table_id\" class=\"abcom abcom-table\">\r\n	        <thead>\r\n	            <tr>\r\n	                <th>Column 1</th>\r\n	                <th>Column 2</th>\r\n	                <th>Column 2</th>\r\n	                <th>Column 2</th>\r\n	                <th>Column 2</th>\r\n	            </tr>\r\n	        </thead>\r\n	        <tbody>\r\n	            <tr>\r\n	                <td>Row 1 Data 1</td>\r\n	                <td><progress class=\"abcom-progress\" data-status=\"For Approval\" value=\"60\" max=\"100\"></progress></td>\r\n	                <td>Row 1 Data 2</td>\r\n	                <td>Row 1 Data 2</td>\r\n	                <td>Row 1 Data 2</td>\r\n	            </tr>\r\n	            <tr>\r\n	                <td>Row 2 Data 1</td>\r\n	                <td><progress class=\"abcom-progress\" value=\"30\" data-status=\"For Endorsement\" max=\"100\"></progress></td>\r\n	                <td>Row 2 Data 2</td>\r\n	                <td>Row 2 Data 2</td>\r\n	                <td>Row 2 Data 2</td>\r\n	            </tr>\r\n	        </tbody>\r\n	    </table><!-- // End abcom-table -->\r\n	</div>\r\n</div>";
