this["App"]["Templates"]["reusables/abcom-table"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<h2>Tables</h2>\r\n<hr>\r\n<h3>Table Tag</h3>\r\n<p>Tables in Aboitiz Legal utilizes the <code>Data Tables</code> plugin.</p>\r\n<p>Here is the basic view of Data Tables. The table must have an ID and is used on initialization.</p>\r\n<div class=\"panel panel-default\">\r\n  <div class=\"panel-body\">\r\n    <table id=\"table_id\" class=\"abcom abcom-table\">\r\n        <thead>\r\n            <tr>\r\n                <th>Column 1</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td>Row 1 Data 1</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Row 2 Data 1</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n            </tr>\r\n        </tbody>\r\n      </table><!-- // End abcom-table -->\r\n  </div>\r\n</div>\r\n<pre class=\"yondu__code\"><code>&lt;table id=&quot;table_id&quot; class=&quot;abcom abcom-table&quot;&gt;\r\n    &lt;thead&gt;\r\n        &lt;tr&gt;\r\n            &lt;th&gt;Column 1&lt;/th&gt;\r\n            &lt;th&gt;Column 2&lt;/th&gt;\r\n            &lt;th&gt;Column 2&lt;/th&gt;\r\n            &lt;th&gt;Column 2&lt;/th&gt;\r\n            &lt;th&gt;Column 2&lt;/th&gt;\r\n        &lt;/tr&gt;\r\n    &lt;/thead&gt;\r\n    &lt;tbody&gt;\r\n        &lt;tr&gt;\r\n            &lt;td&gt;Row 1 Data 1&lt;/td&gt;\r\n            &lt;td class=&quot;is-status&quot;&gt;Row 1 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 1 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 1 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 1 Data 2&lt;/td&gt;\r\n        &lt;/tr&gt;\r\n        &lt;tr&gt;\r\n            &lt;td&gt;Row 2 Data 1&lt;/td&gt;\r\n            &lt;td class=&quot;is-status&quot;&gt;Row 2 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 2 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 2 Data 2&lt;/td&gt;\r\n            &lt;td&gt;Row 2 Data 2&lt;/td&gt;\r\n        &lt;/tr&gt;\r\n    &lt;/tbody&gt;\r\n&lt;/table&gt;</code></pre>\r\n\r\n<hr>\r\n<h3>Initialize using Javascript</h3>\r\n<p>Include a <code>&lt;script&gt;</code> tag at the bottom of your HTML document -- before the <code>&lt;/body&gt;</code> tag -- and use the following code.</p>\r\n<pre class=\"yondu__code\"><code>$('.abcom-table').DataTable();</code></pre>\r\n\r\n<hr>\r\n<h3>Removing other elements</h3>\r\n<div class=\"panel panel-default\">\r\n  <div class=\"panel-body\">\r\n    <table id=\"table_id2\" class=\"abcom abcom-table\">\r\n        <thead>\r\n            <tr>\r\n                <th>Column 1</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td>Row 1 Data 1</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Row 2 Data 1</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n            </tr>\r\n        </tbody>\r\n      </table><!-- // End abcom-table -->\r\n  </div>\r\n</div>\r\n<p>Include a <code>&lt;script&gt;</code> tag at the bottom of your HTML document -- before the <code>&lt;/body&gt;</code> tag -- and use the following code.</p>\r\n<pre class=\"yondu__code\"><code>$('.abcom-table').DataTable({\r\n  searching : false,\r\n  paging : false,\r\n  info : false\r\n});</code></pre>\r\n<p>Here, we used data table options like <code>searching</code>, <code>paging</code> and <code>info</code> for the layout. You can always refer to datatables plugin documentation <a href=\"https://www.datatables.net/\" target=\"_blank\" >here</a>.</p>\r\n\r\n<hr>\r\n<h3>Aboitiz Status</h3>\r\n<div class=\"panel panel-default\">\r\n  <div class=\"panel-body\">\r\n    <table id=\"table_id2\" class=\"abcom abcom-table\">\r\n        <thead>\r\n            <tr>\r\n                <th>Column 1</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n                <th>Column 2</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td>Row 1 Data 1</td>\r\n                <td class=\"is-status\">Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n                <td>Row 1 Data 2</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Row 2 Data 1</td>\r\n                <td class=\"is-status\">Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n                <td>Row 2 Data 2</td>\r\n            </tr>\r\n        </tbody>\r\n    </table><!-- // End abcom-table -->\r\n  </div>\r\n</div>";
},"useData":true});

